;/li&gt;\n          &lt;li&gt; Dask Version: 2021.04.1+17.gc3993fd9 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.04.1+9.g233ec884 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    client = Client(n_workers=10, threads_per_worker=1)\n    print(client)\n\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.monotonic()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.monotonic()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.monotonic()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.monotonic()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.monotonic()\n            df2.head()\n            stop = time.monotonic()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.monotonic()\n            anom_mean.compute()\n            stop = time.monotonic()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{"callback":{"id":"1134"}},"id":"1135","type":"TapTool"},{"attributes":{},"id":"1163","type":"CategoricalTicker"},{"attributes":{},"id":"1078","type":"LinearScale"},{"attributes":{},"id":"1194","type":"CategoricalTicker"},{"attributes":{"data_source":{"id":"1002"},"glyph":{"id":"1031"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1034"}},"id":"1033","type":"GlyphRenderer"},{"attributes":{},"id":"1219","type":"Title"},{"attributes":{"axis":{"id":"1082"},"ticker":null,"visible":false},"id":"1085","type":"Grid"},{"attributes":{"format":"0.0 b"},"id":"1202","type":"NumeralTickFormatter"},{"attributes":{"axis":{"id":"1159"},"ticker":null},"id":"1161","type":"Grid"},{"attributes":{"dimensions":"width"},"id":"1057","type":"WheelZoomTool"},{"attributes":{"base":1024,"mantissas":[1,2,4,8,16,32,64,128,256,512]},"id":"1204","type":"AdaptiveTicker"},{"attributes":{"child":{"id":"1038"},"title":"Scheduler Profile (administrative)"},"id":"1213","type":"Panel"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"bandwidth","transform":{"id":"1147"}},"height":{"value":1},"line_alpha":{"value":0.1},"line_color":{"field":"bandwidth","transform":{"id":"1147"}},"width":{"value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"11
